
import { FaCalendarAlt } from 'react-icons/fa'; // Import the calendar icon from react-icons

function MainContent() {
  const now = new Date();
  const formattedDate = now.toLocaleDateString('en-US', { month: 'long', day: 'numeric', year: 'numeric' });
  const formattedTime = now.toLocaleTimeString('en-US', { hour: 'numeric', minute: 'numeric', hour12: true });

  const daysOfWeek = ['Sunday', 'Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday'];
  const currentDay = daysOfWeek[now.getDay()];

  return (
    <div className="w-full bg-[#5A6CF1] h-48 mt-2 rounded-xl relative">
      <div className="absolute top-2 left-2 bg-white p-2 rounded-xl opacity-60 font-semibold flex items-center">
        <FaCalendarAlt className="mr-2 text-lg" />
        <div>
          {formattedDate} <br />
          {formattedTime}
        </div>
      </div>

      <div className="absolute bottom-4 left-2 text-white p-2">
        <h2 className="text-3xl font-bold">
          Good Day, Ronak R. Patel
        </h2>
        <div className="text-sm mt-1">
          Have a Nice {currentDay}!
        </div>
      </div>

      {/* <div className="absolute bottom-2 right-2">
        <img
          src="data:image/png;base64," 
          alt="Faculty Vector"
          className="w-1/3 h-1/3" 
        />
      </div> */}
    </div>
  );
}

export default MainContent;
